    padding-left: 20px;
    line-height: 30px;
}
.markdown-div blockquote{
    border-left:6px solid #C0C0C0;
    background-color:#F5F5F5;
    padding: 15px 10px 15px 10px;
}
.markdown-checkbox{
    width: 15px;
    height: 20px;
    vertical-align: middle;
}
.markdown-div,.markdown-h{
    text-align: left;
}
.markdown-div hr{
    border-color: #F0F0F0;
}
.markdown-div{
    font-size: 1em;
    padding:0 20px;
    height: 100%;
    word-wrap: break-word;
    word-break: break-all; 
    font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif; 
}

.markdown-code{
    font-family: 'Consolas,Menlo,Courier,monospace';
    color:#abb2bf;
    text-align: left;
    font-size: 0.8em;
}

.markdown-pre{
    width: 85%;
    background-color: black;
    padding: 2px 20px 2px 25px;
    overflow: auto;

}
.markdown-blue{
    color:#4c92d3;
}
.markdown-pink{
    color:#cd9bcb;
}
.markdown-red{
    color:#d87f7c;
}
.markdown-gray{
    color: #666666;
}
.markdown-yellow{
    color:#c5b484;
}
.markdown-lightblue{
    color:#74bff0;
}
.markdown-orange{
    color:#d8a38b;
}
.markdown-td-left{
    padding-left: 5px;
    border:1px solid #abb2bf;
    text-align: left;
}
.markdown-td-right{
    padding-right: 5px;
    border:1px solid #abb2bf;
    text-align: right;
}
.markdown-td-center{
    border:1px solid #abb2bf;
    text-align: center;
}
.markdown-td-0{
    background-color: #E1E1E1;
}
.markdown-td-1{
    background-color:#F5F5F5;
}
.markdown-table{
    width: 80%;
    border-collapse:collapse;
}
.markdown-table td{
    line-height: 40px;
}
.markdown-image{
    border: 0;
    max-width: 100%;
    vertical-align: middle;
}
.markdown-image-div{
    text-align: center;
}
.markdown-image-text{
    min-width: 20%;
    max-width: 80%;
    padding: 10px;
    margin: 0 auto;
    display: inline-block;
    color:#999;
    font-size: 0.5em;
    border-bottom: 1px solid #d9d9d9;
}
.markdown-url-a{
   outline:none;
   cursor: pointer;
   text-decoration:none; 
   color:#1890ff;
}
.markdown-div .markdown-checkbox-ul{
    list-style-type: none;
    padding-left: 0;
}
.markdown-checkbox-ul>li{
    color: #666666;
}
.markdown-textarea{
    width: 100%;
    height: 100%;
    margin-bottom: 0;
    resize: none;
    color: #333;
    background-color: transparent;
    font-size: 1em;
    font-weight: 400;
    line-height: 30px;
    border: none;
    outline: none;
    overflow: auto;
}
.markdown-textarea-div{
    height: 100%;
    display: inline-block;
    width: 50%;
    box-sizing: border-box;
    padding: 0 20px; 
    border-right: 2px solid #cccccc;
}
.markdown-textarea-title{
    background-color: #666666;
    height:30px;
    width: 50%;
    margin: 0;
    padding: 0;
    position: absolute;
    left: 0;
}
.markdown-show{
    height: 100%;
    display: inline-block;
    width:50%;
    box-sizing: border-box;
    background-color: #fdfbf5;
    overflow-y: auto;
}
.markdown-clearfloat{
    height: 100%;
    width: 100%;
